    TYPE typ_tab_adc IS TABLE OF typ_rec_adc INDEX BY PLS_INTEGER;
    vr_typ_adc typ_tab_adc;
  
    CURSOR cr_crapcop IS
      SELECT c.cdcooper, a.cdadmcrd
        FROM crapcop c, crapadc a
       WHERE c.flgativo = 1
         AND c.cdcooper <> 3
