    PROCEDURE pc_insere_tabela_bins_afin(pr_cdcooper     IN tbcrd_grupo_afinidade_bin.cdcooper%TYPE,
                                         pr_cdadmcrd     IN tbcrd_grupo_afinidade_bin.cdadmcrd%TYPE,
